import React from 'react';
import optionsComparison from '../../../helper/OptionsComparison';

const SelectComparison = () => (
  <select
    data-testid="data-testid='comparison-filter'"
  >
    {optionsComparison.map((opt) => (
      <option
        key={ opt }
      >
        {opt}
      </option>
    ))}
  </select>
);

export default SelectComparison;
